  beforeEach(async () => {
    await TestBed.configureTestingModule({
      imports: [ListingFormComponent]
    })
    .compileComponents();
    
    fixture = TestBed.createComponent(ListingFormComponent);
    component = fixture.componentInstance;
    fixture.detectChanges();
